import React from "react";
import { FaSun, FaMoon } from "react-icons/fa";

const Navbar = ({ darkMode, toggleDarkMode }) => {
  return (
    <nav
      className={`fixed w-full top-0 z-50 flex items-center justify-between px-6 md:px-20 py-4 shadow-md transition-colors duration-300 ${
        darkMode ? "bg-gray-900 text-white" : "bg-white text-gray-900"
      }`}
    >
      {/* Stylish LOGO */}
      <a
        href="#home"
        className="text-4xl font-black tracking-wide relative group"
      >
        <span className="text-transparent bg-clip-text bg-gradient-to-r from-cyan-400 via-indigo-500 to-fuchsia-500 group-hover:blur-sm transition duration-500">
          Harsh.
        </span>
        <span className="absolute inset-0 text-transparent bg-clip-text bg-gradient-to-r from-pink-500 via-purple-500 to-blue-500 opacity-0 group-hover:opacity-100 transition duration-500">
          Harsh.
        </span>
      </a>

      {/* Navigation Links */}
      <ul className="hidden sm:flex gap-6 text-sm font-semibold">
        <li>
          <a href="#skills" className="hover:text-blue-500 transition">Skills</a>
        </li>
        <li>
          <a href="#projects" className="hover:text-blue-500 transition">Projects</a>
        </li>
        <li>
          <a href="#experience" className="hover:text-blue-500 transition">Experience</a>
        </li>
        <li>
          <a href="#contact" className="hover:text-blue-500 transition">Contact</a>
        </li>
      </ul>

      {/* Dark Mode Toggle */}
      <button
        onClick={toggleDarkMode}
        className="ml-4 text-xl p-2 rounded-full hover:bg-gray-200 dark:hover:bg-gray-700 transition"
        aria-label="Toggle dark mode"
      >
        {darkMode ? <FaSun className="text-yellow-400" /> : <FaMoon className="text-blue-500" />}
      </button>
    </nav>
  );
};

export default Navbar;
